        if current_size!= len(forest):
            stack.append(forest)
            forest = {}
            visited = set()

        # Add the current vertex to the visited set
        visited.add(current)

        # Remove the current vertex from the forest
        for u in forest[current]:
            del forest[current][forest[current].index(u)]

        # If the current vertex has not been visited, add it to the stack
        if current not in visited:
            stack.append(forest)
            forest = {}
            visited = set()

