        if start >= len(s) or end >= len(s):
            return False
        for i in range(start, end + 1):
            if s[i - 1] == substr[0] and s[i] == substr[1] and s[i + 1] == substr[-1]:
                return substring_exists(i + 2, end, substr[2:])
        return False

    min_length = float('inf')
    min_substring = ''

    for i in range(n):
        substring = s[:i] + 'R' + s[i + 1:]
        if find_substring(0, len(substring)):
            min_substring = substring
            min_length = min(min_length, len(substring))

    for i in range(n - k):
        substring = s[:i] + 'R' + s[i + k]
        if substring_exists(0, len(substring), s[i:i + k]):
            min_substring = substring
            min_length = min(min_length, len(substring))

