        # Handle the current tile
        if not visited[pos // N][pos % N]:
            visited[pos // N][pos % N] = True
            if tile == 'S':
                # If the current position is the starting position, we can reach it
                min_zones = min(min_zones, pos // N + 1)
            elif tile == 'U':
