                pos -= 1
            elif tile == 'D':
                # If the current position is below, move to the right
                pos += 1
            elif tile == 'L':
                # If the current position is to the left, move up
                pos //= N
            elif tile == 'R':
                # If the current position is to the right, move down
                pos *= N
            else:
                # If the current position is safe, move to the next safe position
                continue
        else:
