def solution(stdin: str) -> str:
    lines = [line.strip() for line in stdin.split('\n')]
    n = len(lines)
    total_crowns = 0.0
    for i in range(n):
        line = lines[i]
        if line == "buy":
            x, y = map(int, line.split())
            total_crowns += x * y
        elif line == "sell":
            x, y = map(int, line.split())
            total_crowns -= x * y
        elif line == "split":
            x = int(line.split()[1])
            total_crowns += (n - x + 1) * y
        elif line == "merge":
            x = int(line.split()[1])
            total_crowns += x * (n - x)
        elif line == "die":
            total_crowns += line.split()[1] * 1.0

    return f"{total_crowns:.15f}"

