def solution(stdin: str) -> str:
    S, C, K = map(int, stdin.split())
    socks = list(map(int, stdin.strip().split()))
    total_colors = sum(socks)
    machines = total_colors // C
    max_diff = max(abs(socks[i] - socks[i + 1]) for i in range(len(socks) - 1))

    for i in range(machines):
        used_colors = 0
        colors_to_be_used = set()
        for j in range(i, machines):
            socks_to_be_wash = set(range(machines))
            socks_to_be_wash.remove(j)
            for k in range(machines):
                if k!= j:
                    socks_to_be_wash.remove(k)
            washing_machines = socks_to_be_wash.difference(set(range(machines)))
            if len(washing_machines) == 1:
                used_colors += 1
                colors_to_be_used.add(washing_machines.pop())
            else:
                break

        if used_colors == 0:
            return "No machines"
        min_diff = min(abs(socks[i] - socks[i + 1]) for i in range(len(socks) - 1))
        diff = max_diff - min_diff
        if diff < K:
            return str(machines - 1 - i)

    return "No machines"

