def solution(stdin: str) -> str:
    n = int(stdin)
    def hailstone(n):
        if n == 1:
            return [n]
        elif n % 2 == 0:
            return hailstone(n // 2) + [n]
        else:
            return hailstone(3 * n + 1) + [n]

    sequences = hailstone(n)
    sequence_sum = sum(sequences)
    return str(sequence_sum)

def solution(stdin: str) -> str:
    n = int(stdin.strip())

    if n == 1:
        return "impossible"

    # Get the number of students in each room
    students_in_room = [int(x) for x in stdin.strip().split()]

    # Check if there are any students in the room who can receive their own exam to review
    for i in range(n):
        if students_in_room[i] == 0:
            return "impossible"

    # Find the safe order in which to visit the rooms
    safe_order = []
    rooms_visited = set()

    for i in range(n):
        # Check if there are any students in the room who can receive their own exam to review
        if students_in_room[i] == 0:
            continue

        # Visit the room and store the order
        rooms_visited.add(i)
        for j in range(i + 1, n):
            if j not in rooms_visited and students_in_room[j] > 0:
                safe_order.append(i)
                students_in_room[i] -= 1
                break

    # Check if there is no possible order
    if len(safe_order) == n:
        return "impossible"

    # Output the safe order
    for i in safe_order:
        print(i + 1)

